        btnLink = {'/contact'}
        imgLink={'https://th.bing.com/th/id/R.3fa0a8968c09c360df8c9a94c7bef361?rik=SOyGHc4sH1YEbg&riu=http%3a%2f%2fbargadss.com%2fwp-content%2fthemes%2fbargads%2fimg%2fwebsite_dev%2fwebdev-img-01.png&ehk=3i4cil%2bYEv9pdSRAjOpihRbnW0pQ8vC21WOS01D6rYc%3d&risl=&pid=ImgRaw&r=0'}
        />
        </>
    )
}
export default About;
